import {Button} from 'react-bootstrap';

export const LoginButton = () => {
  return (
    <Button bsClass="loginButton" href='/login'>
        Logga in
    </Button>
  );
};

export const LogoutButton = () => {
    return (
      <Button bsClass="logoutButton" href='/logout'>
          Logga ut
      </Button>
    );
};

export const RegisterButton = () => {
    return (
      <Button bsClass="registerButton" href='/register'>
          Skapa konto
      </Button>
    );
};
